import { useNavigate } from "react-router-dom"

export const FutureBookings = () => {
    const navigate = useNavigate()

    const futureBookingsRequest = () => {

        return <button className="reviewFutureBookings"
            onClick={() => {
                navigate(`/myrequest/futureBookings`)
            }}>
            Accepted Bookings
        </button>
    }

    return (<>
    <h2>Accepted Bookings</h2>
        {
            futureBookingsRequest()
        }
    </>)
}
